import styled from 'styled-components';

const Container = styled.div`
    display: flex;
`;

const Logo = styled.div`
  flex: 4;
  padding: 33px;
`;
const MenuItem = styled.div`
  padding: 33px 20px;
`;

const Menu = styled.div`
  display: flex;
  flex: 6;
  text-align: right;
  justify-content: flex-end;
`;

export {
  Container,
  Logo,
  Menu,
  MenuItem
}
